import React from "react";

import LogoImg from '../../static/logo.jpeg'

class Logo extends React.Component {
    constructor(props) {
        super(props);
        this.state={}
    }
    render() {
        return (
            <div style={{width:'500px',float:'left'}}>
                <span className="logo" style={{backgroundImage: `url(${LogoImg})`}}>123</span>
                <span className="text">某 某 某 某 名</span>
            </div>
        )
    }
}
export default Logo;
